    def tab_four_search_inventory_checkout(self):
        barcode_query = str(self.tab_four_scan_barcode_qline.text())

        #if it's a gift card (i.e. upc contains PRRGC) first search sold inventory, if it's in there,
        #add it to a special list that will later be subtracted from total, if it's not been sold, just continue
        #as normal
        if 'PRRGC' in barcode_query:
            for row in self.db_cursor.execute('SELECT * FROM sold_misc_inventory WHERE upc = ? ORDER BY date_added ASC', (barcode_query,)):
                row = list(row)
                value_remaining = float(self.filter_non_numeric(row[MISC_RESERVED_ONE_INDEX]))
                row[MISC_PRICE_INDEX] = value_remaining
                for item in self.tab_four_gift_card_list:
                    if item[MISC_UPC_INDEX] == row[MISC_UPC_INDEX]:
                        self.tab_four_final_checkout_table_refresh()
                        self.tab_four_scan_barcode_qline.clear()
                        self.tab_four_scan_barcode_qline.setFocus()
                        return
                self.tab_four_gift_card_list.append(list(row))
                self.tab_four_final_checkout_table_refresh()
                self.tab_four_scan_barcode_qline.clear()
                self.tab_four_scan_barcode_qline.setFocus()
                return

        #first search inventory, then search misc_inventory
        count = 0
        for row in self.db_cursor.execute('SELECT * FROM inventory WHERE upc = ?', (barcode_query,)):
            count += 1

        keys = []
        for row in self.tab_four_checkout_table_list:
            keys.append(row[ID_INDEX])
        #if only one item is found, add it to list, otherwise, let user choose which item to add
        if count == 1:
            for row in self.db_cursor.execute('SELECT * FROM inventory WHERE upc = ?', (barcode_query,)):
                row_list = list(row)
                #construct a row of the form used in sold_inventory table
                row_list += [-1, 0, '', '', -1, -1, '']
                if(row[ID_INDEX] not in keys):
                    self.tab_four_checkout_table_list.append(row_list)
            self.tab_four_checkout_table_refresh()
            self.tab_four_scan_barcode_qline.clear()
            self.tab_four_scan_barcode_qline.setFocus()
            self.tab_four_checkout_table_refresh()
            return
        elif count > 1:
            self.tab_two_results_table_list = []
            for row in self.db_cursor.execute('SELECT * FROM inventory WHERE upc = ? ORDER BY date_added ASC', (barcode_query,)):
                self.tab_two_results_table_list.append(list(row))
            self.main_menu_tabs.setCurrentIndex(1)
            self.tab_two_results_table_refresh()
            self.tab_two_results_table.selectRow(0)
            self.tab_two_results_table.scrollToTop()
            self.tab_two_results_table.setFocus()
            return

        #now search misc_inventory
        count = 0
        for row in self.db_cursor.execute('SELECT * FROM misc_inventory WHERE upc = ?', (barcode_query,)):
            count += 1

        keys = []
        for row in self.tab_four_misc_checkout_table_list:
            keys.append(row[MISC_ID_INDEX])
        #if only one item is found, add it to the list, otherwise, let user choose which item to add
        if count == 1:
            for row in self.db_cursor.execute('SELECT * FROM misc_inventory WHERE upc = ?', (barcode_query,)):
                row_list = list(row)
                #construct a row of the form used in the misc_sold_inventory_table
                row_list += [-1, 0, '', '', -1, -1, '', '']
                if(row[MISC_ID_INDEX] not in keys):
                    self.tab_four_misc_checkout_table_list.append(row_list)
            self.tab_four_misc_checkout_table_refresh()
            self.tab_four_scan_barcode_qline.clear()
            self.tab_four_scan_barcode_qline.setFocus()
            self.tab_four_misc_checkout_table_refresh()
            return        
        elif count > 1:
            self.tab_three_results_table_list = []
            for row in self.db_cursor.execute('SELECT * FROM misc_inventory WHERE upc = ? ORDER BY date_added ASC', (barcode_query,)):
                self.tab_three_results_table_list.append(list(row))
            self.main_menu_tabs.setCurrentIndex(2)
            self.tab_three_results_table_refresh()
            self.tab_three_results_table.selectRow(0)
            self.tab_three_results_table.scrollToTop()
            self.tab_three_results_table.setFocus()
            return
            
        
