    def filter_non_numeric(self, str_):
        return self.non_decimal.sub('', str_)
    
    def xstr(self,s):
        if s is None:
            return ''
        return str(s)
    
    def xint(self, i):
        if (i is None) or (i == ''):
            return -1
        return int(i)

    def xfloat(self, f):
        if (f is None) or (f == ''):
            return -1
        return float(f)

    def clean_up(self):
        # Clean up everything
        for ii in self.__dict__:
            item = self.__dict__[ii]
            clean(item)

